  width: '100%'
};

function App() {
  return (
    <table style={outerTableStyle}>
    <tbody>
    <tr>
    <td>
    <table style={innerTableStyle}>
    <tbody>



    </tbody>
    </table>  
    </td>
    </tr>
    </tbody>
    </table>
  );
}

export default App;
